import './App.css';
import React, { useState, useEffect } from "react";
import axios from "axios";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/ratings" element={<Ratings />} />
        <Route path="/createuser" element={<CreateUser />} />
        <Route path="/loginuser" element={<LoginUser />} />
        <Route path="/viewrating" element={<ViewRating />} />
        <Route path="/deleterating" element={<DeleteRating />} />
        <Route path="/addnewrating" element={<AddNewRating />} />
        <Route path="/updaterating" element={<UpdateRating />} />
      </Routes>
    </Router>
  );
}

function Pages() {
  return (
    <div>
      <Link to="/ratings">Ratings</Link>
      <Link to="/createuser">Create User</Link>
      <Link to="/loginuser">Login User</Link>
      <Link to="/viewrating">Login User</Link>
      <Link to="/deleterating">Login User</Link>
      <Link to="/addnewrating">Login User</Link>
      <Link to="/upsaterating">Login User</Link>
    </div>
  );
}

export default App;
